import { View, Text } from 'react-native';
import { Screens } from '../types'
import type { Id, Screen } from '../types';
import { NavigationProp } from '../types';


interface TodoDetailsScreenProps {
  id: Id
}

interface ScreenProps extends NavigationProp {
  params: TodoDetailsScreenProps
}

export const TodoDetailsScreen = ({ params }: ScreenProps) => {
  return (
    <>
    <View><Text>Todo Details Screen ({params.id})</Text></View>
    </>
  )
}

const screen: Screen = {
  name: Screens.TodoDetails,
  screen: TodoDetailsScreen
}

export default screen;
